import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { GridList } from '@material-ui/core';
import { GridListTile } from '@material-ui/core';
import { GridListTileBar } from '@material-ui/core';
import img1 from './static/qiuqiu_img/qiuqiu.jpg';
import img2 from './static/qiuqiu_img/qiuqiu1.jpg';
import img3 from './static/qiuqiu_img/qiuqiu2.jpg';
import img4 from './static/qiuqiu_img/qiuqiu3.jpg';
import img5 from './static/qiuqiu_img/qiuqiu4.jpg';
import img6 from './static/qiuqiu_img/qiuqiu5.jpg';
import img7 from './static/qiuqiu_img/qiuqiu6.jpeg';



class ImgLoader extends React.Component {

	render() {
		let classes;
		classes = makeStyles(theme => ({
			root: {
				display: 'flex',
				flexWrap: 'wrap',
				justifyContent: 'space-around',
				overflow: 'hidden',
				backgroundColor: theme.palette.background.paper,
			},
			gridList: {
				flexWrap: 'nowrap',
				transform: 'translateZ(0)',
				},
			titleBar: {
				background: 'linear-gradient(to top, rgba(0,0,0,0.7) 0%, rgba(0,0,0,0.3) 70%, rgba(0,0,0,0) 100%)',
			},
		}));

		return (
			<div className={classes.root}>
				<GridList className={classes.gridList} cols={3}>
					<GridListTile key={img1}>
						<img src={img1} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>	
					<GridListTile key={img2}>
						<img src={img2} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>	
					<GridListTile key={img3}>
						<img src={img3} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>	
					<GridListTile key={img4}>
						<img src={img4} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>	
					<GridListTile key={img5}>
						<img src={img5} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>	
					<GridListTile key={img6}>
						<img src={img6} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>	
					<GridListTile key={img7}>
						<img src={img7} />
						<GridListTileBar
							title='仲qiuqiu'
							classes={{
								root: classes.titleBar,
								title: '仲qiuqiu',
							}}
						/>
					</GridListTile>					
				</GridList>
			</div>
		)
	}
}


export default ImgLoader
